import color_logo from "../images/color-logo.png";
import white_logo from "../images/white-logo.png";

const Nav = ({minimal}) => {

    return (
        <div>
            <div className="logo-container">
                <img
                    className="logo"
                    src={minimal ? color_logo : white_logo}
                    alt="logo"
                />
            </div>
        </div>
    );
};
export default Nav;
